import React from 'react';
import './Result.scss';
import { Container, Row, Col } from 'reactstrap';
import Exemple from '../../containers/result/Exemple';


const Result = () => (
  <Container className="Result">
    <Row>
      <Col xs={12} sm={7}>
        Resultats
      </Col>
      <Col xs={12} sm={5}>
        <Exemple />
      </Col>
    </Row>
  </Container>
);

export default Result;
